let defaultState = {
  roomList: [],
};

const RoomReducer = (state = defaultState, action) => {
  switch (action.type) {
    case "FETCH_ROOM": {
      state.roomList = action.payload;
      return { ...state };
    }

    case "DELETE_ROOM": {
      console.log(action.payload);
    }
    default:
      return state;
  }
};

export default RoomReducer;
